import React, { useCallback } from 'react';
import Link from 'next/link';
import { useSelector } from 'react-redux';
import styles from './Toolbar.module.css';
import { logoutRequestAction } from '../reducers/user';

function Toolbar() {
  const logInDone = useSelector((state) => state.user.logInDone);

  const LogOutHandler = useCallback(() => {
    dispatch(logoutRequestAction());
  }, []);

  return (
    <div className={styles.inner}>
      <div style={{ height: '20px' }} />
      <Link href="/">
        <span className={styles.title}>
          CRUD
        </span>
      </Link>
      {
      logInDone
        ? (
          <span className={styles.toolbar_box}>
            <Link href="Logout">
              <span className={styles.toolbar} onClick={LogOutHandler}>
                로그아웃
              </span>
            </Link>
          </span>
        )
        : (
          <>
            <span className={styles.toolbar_box}>
              <Link href="Signup">
                <span className={styles.toolbar}>
                  회원가입
                </span>
              </Link>
            </span>
            <span style={{ float: 'right', marginRight: 10, fontSize: '19px' }}>
              |
            </span>
            <span className={styles.toolbar_box}>
              <Link href="/Login">
                <span className={styles.toolbar}>
                  로그인
                </span>
              </Link>
            </span>
          </>
        )
      }

      <div className={styles.title_line} />
      <Link href="/Board">
        <span className={styles.side_toolbar}>게시판</span>
      </Link>
      <Link href="/Mypage">
        <span className={styles.side_toolbar}>자기소개</span>
      </Link>
      <Link href="/Studies">
        <span className={styles.side_toolbar}>배운내용들</span>
      </Link>
      <div className={styles.side_toolbar_line} />
    </div>
  );
}

export default Toolbar;
